export async function loadChallenges(id) {
    console.log("loadChallenges", id)
    return {
        "id": 1,
        "name": "Hochzeit Lisa & Flo",
        challenges: [
            {
                id: 1,
                name: "Hochzeitstorte",
                description: "Die Hochzeitstorte ist das Highlight der Feier. Sie wird in der Regel am Abend angeschnitten und serviert. Die Torte kann aus verschiedenen Schichten bestehen und mit verschiedenen Füllungen und Dekorationen versehen sein.",
            },
            {
                id: 2,
                name: "Älteste Paar",
                description: "Das älteste Paar ist ein beliebtes Spiel auf Hochzeiten. Es wird in der Regel am Abend gespielt und besteht darin"
            }
            ]
    }
}
